import React from 'react';
import { Tabs, TabNav, TabNavItem, TabContent, TabPanel } from 'react-smarttab'
import MainTabItems from './MainTabItems.js';
import TabItem from './TabItem.js'

class MainTabNav extends React.Component{
  render() {
    const maintabcomponents = MainTabItems.map(item =>
        <TabItem title = {item.title} className = {item.className} />)
    return (
      <div>
       <Tabs>
         <TabNav>
           <TabNavItem>
              {maintabcomponents}
           </TabNavItem>
         </TabNav>

         // <TabContent>
         //   <TabPanel>
         //     Tab 1 Content
         //   </TabPanel>
         //   <TabPanel>
         //     Tab 2 Content
         //   </TabPanel>
         //   <TabPanel>
         //     Tab 3 Content
         //   </TabPanel>
         // </TabContent>
       </Tabs>
      </div>
    )
  }
}
export default MainTabNav
